            //newly selected record
            var newRecord = _createRecipeEntry(selectedFileEntryInfo.metaFileId,combinedEntry.fileEntry,combinedEntry.insertionInfo);
            result.created.push(newRecord);
        }
        else if((!combinedEntry.selected)&&(combinedEntry.recipeEntry)) {
            //non-selected recipe entry
            //file entry removed from meta file
            result.deleted.push(combinedEntry.recipeEntry);
        }
        else if((combinedEntry.selected)&&(combinedEntry.recipeEntry)) {
            //check for a change in insertion info!
            //different format here - save the initial and final record
            if(!apogee.util.jsonEquals(combinedEntry.recipeEntry.Fields.insertion_info,combinedEntry.insertionInfo)) {
                //modified insertion info
                var oldRecord = combinedEntry.recipeEntry;
                var newRecord = apogee.util.jsonCopy(oldRecord);
                newRecord.Fields.insertion_info = combinedEntry.insertionInfo;
                result.updated.push({"oldEntry":oldRecord,"newEntry":newRecord})
            }
        }
    }


    selectedFileEntryInfo.combinedEntries.forEach(addToResult);
}

return result;

